        <h3>Mon programme du jour</h3>
        {chantiers.length > 0 ? (
          <div className="chantiers">
            {chantiers.map(chantier => (
              <ChantierBox key={chantier.ChantierId} chantier={chantier} />
            ))}
          </div>
        ) : (
          <p>Aucun chantier programm√© pour aujourd'hui.</p>
        )}
      </div>
      <BottomNavbar />
    </div>
  );
};

